import React, { Component } from 'react';
import './Menu.css';

const Menu = (props) => (
    <aside>

        <ul id="slide-out" className="sidenav sidenav-fixed">
            <li id="logo">
                <a id="logo-container">
                    <img id="img-logo" src={process.env.PUBLIC_URL + '/img/wll.png'} />
                </a>
            </li>
            <li><a href="#!">Usuarios</a></li>
        </ul>
    </aside>

)

export default Menu;
